import React from 'react'

const Home = () => {
    const fetchData = () => {
        fetch("/users")
        .then((res)=> { return res.json();})
        .then((data)=> {
            console.log(data);
        })
    }
    return (
        <>
            <h1>Home page</h1>

        </>
    )
}

export default Home
